import React, { Component } from "react";

class AboutSponsorship extends Component {
    render() {
        return (
            <div>
                <h1 className="display-4 theme-font">About HackRU</h1>
                <hr />
                <h2>What is HackRU?</h2>
                <p>HackRU is a 24-hour hackathon at Rutgers University. We welcome hundreds of students to join us in building awesome software and hardware projects. Industry experts and mentors come from all over the country to create an environment that fosters an atmosphere of learning through tech talks and one-on-one guidance. We encourage beginner and advanced hackers alike to challenge themselves and expand their skills. You can learn more about HackRU by reading our articles on <a href="https://medium.com/the-hackru">medium!</a></p>
                <h2>Why sponsor?</h2>
                <p>Sponsoring HackRU is the most powerful recruiting effort you can make for engaging with upcoming tech talent at both Rutgers University and the tech scene at large. The hackathon audience is made up of the industry's most passionate developers, entrepreneurs, and designers. Your representatives will interact directly with these talented potential hires.</p>
                <hr  />
             </div>
        )
    }
}

export default AboutSponsorship;
